import React, { Component } from 'react'


class Map extends Component {



    constructor(props) {
        super(props)

        this.state = {
             name:[
                 "Umesh","Bijender","Sonu","Peter"
             ]
        }
    }


    render() {
        return (
            <div>
        <ul type="circle">
            {this.state.name.map((value)=>(
                <div>
                <li>{value} </li>
                </div>
            ))}
            </ul>    

            </div>
        )
    }
}
 export default Main;
